//Importação
import logo from './logo.svg';
import './App.css';

//Componente necessita começar com letra maiuscula
//App == Componente
function App() {
  //return HTML(JSX)
  return (
    //class é palavra reservada do javaScript, logo tem que ser className
    //entre {} temos um codigo em JS
    //So pode retornar um componente, nesse caso o <div>. Ou ate podemos retornar um <></> --> fraguimento 

    <div className="App"> 
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hello World!!
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

//Exporta o Componente App
export default App;
